import React from 'react';
import '../App.css';
import kimonoJari from '../kimonoJari.png';
//import kimonoTxt from '../kimono.html';


const Goals = () => {
   return (
        <div class='frame'> 
            <h2 style="cursor:pointer" onClick="()=>this.toggle()">
                piu piu {this.state.open ? 'pau' : 'piu'}</h2> 
            <img rt-if="this.state.open" src={kimonoJari}/>


        </div>)
}

export default Goals
